import React, { Component } from 'react';
import { Button } from 'antd';
import TopNavBar from "./components/TopNavBar"
import ProjectSummary from "./components/ProjectSummary"
import ArticleSummary from "./components/ArticleSummary"
import ContactMe from "./components/ContactMe"
import BlogMain from "./components/BlogMain"
import './App.css';

import EntryTrunc from './data/Entry'

import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

const articleEntries = [
  //{EntryTrunc(title="hello", published="1/1/1", summary="this is my summary", resource="www.")}
  {title:"hello1", published:"1/1/1", summary:"this is my summary", resource:"www."} as EntryTrunc,
  {title:"hello2", published:"1/1/1", summary:"this is my summary", resource:"www."} as EntryTrunc,
  {title:"hello3", published:"1/1/1", summary:"this is my summary", resource:"www."} as EntryTrunc,
  {title:"hello4", published:"1/1/1", summary:"this is my summary", resource:"www."} as EntryTrunc,
]

const projectEntries = [
  {title:"hello1", published:"1/1/1", summary:"this is my summary", resource:"www.test"} as EntryTrunc,
  {title:"hello2", published:"1/1/1", summary:"this is my summary", resource:"www.test"} as EntryTrunc,
  {title:"hello3", published:"1/1/1", summary:"this is my summary", resource:"www.test"} as EntryTrunc,
]

class App extends Component {
  render() {
    return (
      <div className="App">
        <Router>
          <TopNavBar />
          <div className="main">
            <Switch>
                <Route path="/home">
                  <div className="parallax">
                    <div className="fade-in-title">hello</div>
                  </div>
                  <h1 style={{marginTop:"20px"}}>--- Blah Blah Blah Recent projects ---</h1>
                  <ProjectSummary entries={projectEntries}/>
                  <ArticleSummary entries={articleEntries} />
                  <ContactMe/>
                  {/*<div className="filler"></div>*/}
                </Route>
                <Route path="/blog/:q"><BlogMain/></Route>
            </Switch>
          </div>
        </Router>
      </div>
    );
  }
}

        {/*<Button type="primary">Button</Button>*/}
export default App;
